import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { getAllUsers } from '../services/api';

export default function Analysis() {
  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    let mounted = true;
    async function load() {
      setLoading(true);
      setError(null);
      try {
        const res = await getAllUsers();
        if (!mounted) return;
        setUsers(res.users || []);
      } catch (err) {
        setError(err.message || 'Failed to load users');
      } finally {
        setLoading(false);
      }
    }
    load();
    return () => { mounted = false; };
  }, []);

  return (
    <div className="container admin-container" style={{ background: 'black', color: 'white', minHeight: '60vh', padding: 20 }}>
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
        <div className="brand"><h2 className="brand-heading">Analytics</h2></div>
        <div>
          <button className="admin-btn" onClick={() => navigate('/admin')}>Back</button>
        </div>
      </div>
      <h1 style={{ color: 'crimson' }}>Users</h1>
      {loading && <p>Loading...</p>}
      {error && <p style={{ color: 'crimson' }}>{error}</p>}
      {!loading && !error && (
        <div style={{ display: 'grid', gap: 8 }}>
          {users.map(u => (
            <button key={u._id} className="admin-btn" onClick={() => navigate(`/analysis/${u._id}`)} style={{ textAlign: 'left', padding: 10 }}>
              {u.name} : {u.email}
            </button>
          ))}
        </div>
      )}
      <div style={{ marginTop: 16 }}>
        <button className="logout-btn" onClick={() => { localStorage.removeItem('token'); navigate('/login'); }}>Logout</button>
      </div>
    </div>
  );
}
